import React from 'react';
import { MDBIcon, MDBBtn } from "mdbreact";


const Packages = () => {
    return (
        <div>
            <h1 className="mt-5 text-center">Afforable Packages for Your Business</h1>
            <div className="d-flex text-center">
                <MDBBtn className="  text-white  ">Logo Desgin</MDBBtn>
                <MDBBtn className="  text-white  ">Website Desgin</MDBBtn>
                <MDBBtn className="  text-white  ">eCommerce</MDBBtn>
            </div>


        </div>
    )
}

export default Packages;
